import Carousel from '../../component/Public/Carousel.js';
import process01 from '../../public/process01.png';
import process02 from '../../public/process02.png';
import process03 from '../../public/process03.png';
import photo3 from '../../public/3.jpeg';
import photo4 from '../../public/4.jpeg';

const Test = () => {
    return(
        <React.Fragment>
            <div>Carousel</div>
            <Carousel
                imgsrc={[process01, process02, process03, photo3, photo4]}
                rotateBy={2}
                width={'600px'}
                height={'500px'}
                navigateButton={true}
                controlButton={true}
            />
        </React.Fragment>
    )
}

export default Test;
